package com.webweeb.backend.entity;import jakarta.persistence.*;import lombok.*;@EqualsAndHashCode(callSuper = true)@Entity@Data@AllArgsConstructor@NoArgsConstructor@Builder@Table(name = "\"Generator\"")public class PasswordGenerator extends BaseEntity {    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "user_id", referencedColumnName = "id")    private User user;    private long characterLength;    private boolean includeUppercase;    private boolean includeLowercase;    private boolean includeNumbers;    private boolean includeSpecialCharacters;    private boolean avoidAmbiguousCharacters;    private boolean avoidSimilarCharacters;    private boolean avoidRepetitiveCharacters;    private boolean avoidSequentialCharacters;    private boolean avoidKeyboardPatterns;    private boolean avoidCommonWords;    private boolean avoidPersonalInformation;    private boolean avoidContextualWords;    private boolean avoidCommonPhrases;    private String password;}